import React, { Component } from "react";

export default class Test extends Component {
  render() {
    if (this.props.user) {
      return (
        <h2>
         Testing
        </h2>
      );
    }
    return (
      <div className="home">
        <div className="body">
          <h3>Rewardsco</h3>
        </div>
      </div>
    );
  }
}
